    - type: Paper
      content: Йар-р, передаю всем матросам ,которые заступают на смену в это ржавое судно.  Мы тут поймали какого-то, чёрт его дери, атмосферного техника, который попытался тут что-то настроить, чтобы мы не передохли тут от недостатка воздуха.. Сказал ,что когда ставишь синюю бочку, то нужно нажимать по кнопке под воздушной, как ее там, сигнализацией, во! Загорится лампа, которая укажет на то, что газ закачивается. Далее, как же сложно, нужно при помощи какого-то анализатора проверить количество газа и убедиться в том, что все закачалось. С красной бочкой тоже самое, но кнопка другая, главное выключать насосы, чтобы лампы не горели...  Ах да, за то что он нам тут намудрил такую атмос-зону, хе-хе, мы вместо честной свободы, поместили его в камеру с газом, во умора, теперь вечно будет покоиться в своей же камере...  Йар-р, не намудрите тут, не хватало еще, чтобы мы как крысы задохнулись из-за какого-то зеленого матроса!
